import React from "react";
import {Grid} from '@mui/material/Unstable_Grid2'; // Grid version 2
import Item from '@mui/material';

const Login = () => {

    return (
        <Grid container spacing={2}>
            <Grid xs={8}>
            <Item>xs=8</Item>
            </Grid>
            <Grid xs={4}>
            <Item>xs=4</Item>
            </Grid>
            <Grid xs={4}>
            <Item>xs=4</Item>
            </Grid>
            <Grid xs={8}>
            <Item>xs=8</Item>
            </Grid>
        </Grid>
    )
}

export default Login;
